import React, { useEffect } from 'react';

const ComingSoonPage = () => {
  useEffect(() => {
    // Initialize your JavaScript libraries and code here
    $(document).ready(function() {
          // jQuery
    const $ = require('../statics/vendor/jquery/jquery-3.2.1.min.js');
    
    // Bootstrap
    require('../statics/vendor/bootstrap/js/popper.js');
    require('../statics/vendor/bootstrap/js/bootstrap.min.js');
    
    // Select2
    require('../statics/vendor/select2/select2.min.js');
    
    // Countdowntime
    require('../statics/vendor/countdowntime/moment.min.js');
    require('../statics/vendor/countdowntime/moment-timezone.min.js');
    require('../statics/vendor/countdowntime/moment-timezone-with-data.min.js');
    require('../statics/vendor/countdowntime/countdowntime.js');
    
    // Initialize countdown100
    $('.cd100').countdown100({
      endtimeYear: 0,
      endtimeMonth: 0,
      endtimeDate: 35,
      endtimeHours: 19,
      endtimeMinutes: 0,
      endtimeSeconds: 0,
      timeZone: ""
      // ex:  timeZone: "America/New_York"
      // go to "http://momentjs.com/timezone/" to get timezone
    });
    
    // Tilt
    require('../statics/vendor/tilt/tilt.jquery.min.js');
    
    // Initialize tilt
    $('.js-tilt').tilt({
      scale: 1.1
    });
    })


    // You can add any other initialization code here

  }, []);
  return (
    <>
  <title>Coming Soon 13</title>
  <meta charSet="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  {/*===============================================================================================*/}
  <link rel="icon" type="image/png" href="images/icons/favicon.ico" />
  {/*===============================================================================================*/}
  <link
    rel="stylesheet"
    type="text/css"
    href="../statics/vendor/bootstrap/css/bootstrap.min.css"
  />
  {/*===============================================================================================*/}
  <link
    rel="stylesheet"
    type="text/css"
    href="../statics/fonts/font-awesome-4.7.0/css/font-awesome.min.css"
  />
  {/*===============================================================================================*/}
  <link
    rel="stylesheet"
    type="text/css"
    href="../statics/fonts/iconic/css/material-design-iconic-font.min.css"
  />
  {/*===============================================================================================*/}
  <link rel="stylesheet" type="text/css" href="../statics/vendor/animate/animate.css" />
  {/*===============================================================================================*/}
  <link
    rel="stylesheet"
    type="text/css"
    href="../statics/vendor/select2/select2.min.css"
  />
  {/*===============================================================================================*/}
  <link rel="stylesheet" type="text/css" href="../statics/css/util.css" />
  <link rel="stylesheet" type="text/css" href="../statics/css/main.css" />
  {/*===============================================================================================*/}
  {/*  */}
  <div className="simpleslide100">
    <div
      className="simpleslide100-item bg-img1"
      style={{ backgroundImage: 'url("images/bg01.jpg")' }}
    />
    <div
      className="simpleslide100-item bg-img1"
      style={{ backgroundImage: 'url("images/bg02.jpg")' }}
    />
    <div
      className="simpleslide100-item bg-img1"
      style={{ backgroundImage: 'url("images/bg03.jpg")' }}
    />
    <div
      className="simpleslide100-item bg-img1"
      style={{ backgroundImage: 'url("images/bg04.jpg")' }}
    />
  </div>
  <div className="flex-col-c-sb size1 overlay1 p-l-75 p-r-75 p-t-20 p-b-40 p-lr-15-sm">
    {/*  */}
    <div className="w-full flex-w flex-sb-m">
      <div className="wrappic1 m-r-30 m-t-10 m-b-10">
        <a href="#">
          <img src="images/icons/logo.png" alt="LOGO" />
        </a>
      </div>
      <div className="flex-w cd100 p-t-15 p-b-15 p-r-36">
        <div className="flex-w flex-b m-r-22 m-t-8 m-b-8">
          <span className="l1-txt1 wsize1 days">35</span>
          <span className="m1-txt1 p-b-2">Days</span>
        </div>
        <div className="flex-w flex-b m-r-22 m-t-8 m-b-8">
          <span className="l1-txt1 wsize1 hours">17</span>
          <span className="m1-txt1 p-b-2">Hr</span>
        </div>
        <div className="flex-w flex-b m-r-22 m-t-8 m-b-8">
          <span className="l1-txt1 wsize1 minutes">50</span>
          <span className="m1-txt1 p-b-2">Min</span>
        </div>
        <div className="flex-w flex-b m-r-22 m-t-8 m-b-8">
          <span className="l1-txt1 wsize1 seconds">39</span>
          <span className="m1-txt1 p-b-2">Sec</span>
        </div>
      </div>
      <div className="m-t-10 m-b-10">
        <a href="#" className="size2 s1-txt1 flex-c-m how-btn1 trans-04">
          Sign Up
        </a>
      </div>
    </div>
    {/*  */}
    <div className="flex-col-c-m p-l-15 p-r-15 p-t-80 p-b-90">
      <h3 className="l1-txt2 txt-center p-b-55 respon1">Coming Soon</h3>
      <div>
        <button className="how-btn-play1 flex-c-m">
          <i className="zmdi zmdi-play" />
        </button>
      </div>
    </div>
    <div className="flex-sb-m flex-w w-full">
      {/*  */}
      <div className="flex-w flex-c-m m-t-10 m-b-10">
        <a
          href="#"
          className="size3 flex-c-m how-social trans-04 m-r-3 m-l-3 m-b-3 m-t-3"
        >
          <i className="fa fa-facebook" />
        </a>
        <a
          href="#"
          className="size3 flex-c-m how-social trans-04 m-r-3 m-l-3 m-b-3 m-t-3"
        >
          <i className="fa fa-twitter" />
        </a>
        <a
          href="#"
          className="size3 flex-c-m how-social trans-04 m-r-3 m-l-3 m-b-3 m-t-3"
        >
          <i className="fa fa-youtube-play" />
        </a>
      </div>
      <form className="contact100-form validate-form m-t-10 m-b-10">
        <div
          className="wrap-input100 validate-input m-lr-auto-lg"
          data-validate="Email is required: ex@abc.xyz"
        >
          <input
            className="s2-txt1 placeholder0 input100 trans-04"
            type="text"
            name="email"
            placeholder="Email Address"
          />
          <button className="flex-c-m ab-t-r size4 s1-txt1 hov1">
            <i className="zmdi zmdi-long-arrow-right fs-16 cl1 trans-04" />
          </button>
        </div>
      </form>
    </div>
  </div>
  {/*===============================================================================================*/}
  {/*===============================================================================================*/}
  {/*===============================================================================================*/}
  {/*===============================================================================================*/}
  {/*===============================================================================================*/}
  {/*===============================================================================================*/}
</>

  );
};

export default ComingSoonPage;
